class Page extends Component {
  state = {
    alertColor: ['#ca2621', '#f5a623', '#549be8'],
    colors: ['#3DADFF', '#03C5DE', '#12D9B0', '#EDBA42', '#F4704E', '#ED6899', '#7F62C3', '#6E7BC9', '#7ED321']
  }

  onEngineClick(e, option) {
    if (this.utils.isDev()) { return }
    localStorage.setItem('sharedOrg', '');
    const { engine, status } = option;
    const tableState = this.state.tableState || [];
    switch (status) {
      case 'Abnormal':
        url = `/clusters?${this.utils.qs.stringify({
          engine: engine ? [engine] : [],
          status: this.utils.clusterStatus?.abnormal || []
        })}`;
        this.history.push(url);
        break;
      case 'Normal':
        url = `/clusters?${this.utils.qs.stringify({
          engine: engine ? [engine] : [],
          status: this.utils.clusterStatus?.normal || []
        })}`;
        this.history.push(url);
        break;
      default:
        url = `/clusters?${this.utils.qs.stringify({
          engine: engine ? [engine] : []
        })}`;
        this.history.push(url);
        break;
    }
    const clusterContainer = document.querySelector("[box-id='clusters']");
    if (clusterContainer) {
      clusterContainer.scrollIntoView({ behavior: "smooth", block: "start", inline: "nearest" });
    }
  }

  groupByEngine(cluster) {
    if (!cluster?.length) { return }
    const engines = cluster.reduce((p, c) => {
      const { engine, status } = c;
      const o = p[engine] || { count: 0, normal: 0, abnormal: 0 };
      o.count += 1;
      const abnormalStatus = this.utils.clusterStatus?.abnormal || []
      if (abnormalStatus.includes(status)) {
        o.abnormal += 1;
      } else {
        o.normal += 1;
      }
      p[engine] = o;
      return p;
    }, {})
    return Object.entries(engines).map(item => ({
      engine: item[0],
      count: item[1].count,
      normal: item[1].normal,
      abnormal: item[1].abnormal
    })).sort((a, b) => (a.count !== b.count) ? (b.count - a.count) : (a.engine.localeCompare(b.engine)));
  }

  async getCluster() {
    const { items } = await this.dataSourceMap.listCluster.load();
    const engines = this.groupByEngine(items);
    this.setState({
      engines
    })
  }

  //备份size转化单位
  sizeInBytes(size) {
    const units = {
      'kB': 1024,
      'MB': 1024 * 1024,
      'GB': 1024 * 1024 * 1024
    };
    const [value, unit] = size.split(' ');
    return parseFloat(value) * units[unit];
  };

  formatSize(size) {
    const units = ['B', 'Ki', 'Mi', 'Gi', 'Ti'];
    let unitIndex = 0;
    while (size >= 1024 && unitIndex < units.length - 1) {
      size /= 1024;
      unitIndex++;
    }
    if (size % 1 === 0) { 
      return size.toFixed(0) + units[unitIndex];
    } else {
      return size.toFixed(2) + units[unitIndex];
    }
  };

  async getbackup() {
    const res = await this.dataSourceMap.getBackupStats.load();
    const totalSizeInBytes = _.sumBy(res?.backupStatsEngine, item => Number(item.backupSize));
    const backupTotalSize = this.formatSize(totalSizeInBytes);
    const convertBackups = res?.backupStatsEngine ? res.backupStatsEngine.map(item => ({
      ...item,
      backupSize: this.formatSize(Number(item.backupSize)),
      type: item.engineName,
      percent: totalSizeInBytes === 0 ? 0 : Number(((item.backupSize / totalSizeInBytes)*100).toFixed(2))
    })): [];
    const backupTotal = _.sumBy(res?.backupStatsEngine, item => Number(item.backupNum));



    if (res) {
      const engineSizes = _.orderBy(convertBackups, ['backupSize'], ['desc']);
      const engineCounts = _.orderBy(convertBackups, ['backupNum'], ['desc']);
      this.setState({
        backupTotal,
        backupTotalSize,
        engineSizes,
        engineCounts,
        backupStatsStatus: res.backupStatsStatus
      })
    } else {
      this.setState({
        backupTotal: 0,
        backupTotalSize: 0,
        engineSizes: [],
        engineCounts: [],
        backupStatsStatus: [],
      })
    }
  }

  async getAlerts() {
    let { items } = await this.dataSourceMap.listAlertObjects.load();

    let resolved = [], unresolved = [];
    let warningOverview = {
      severity: { critical: 0, warning: 0, info: 0 },
      engine: {},
      alertName: {},
      clusterName: {}
    };
    if (items) {
      items.map(item => {
        const { severity, engine, alertName, clusterName } = item;
        if (item.status === 'resolved') {
          resolved.push(item);
        } else {
          unresolved.push(item);
          if (!warningOverview.severity[severity]) {
            warningOverview.severity[severity] = 1;
          } else {
            warningOverview.severity[severity] += 1;
          }
        }
      });
    }
    warningOverview.severity = Object.entries(warningOverview.severity).map(item => { return { type: item[0], value: item[1] } });
    warningOverview.severityCount = warningOverview.severity.reduce((pre, cur) => { return cur ? pre + cur.value : pre; }, 0);
    this.setState({
      warningOverview,
    })
  }

  onCreate(event) {
    if (this.utils.isDev()) return;
    this.history.push(`/clusters/create`)
  }

  onBackupClick(e, array) {
    if (this.utils.isDev()) return;
    if (array?.length > 1){
      this.history.push(`/backup/list?status=${array[0]}&status=${array[1]}`)
    }else{
      this.history.push(`/backup/list?status=${array[0]}`)
    }
  }

  onAlertClick(e, text) {
    if (this.utils.isDev()) return;
    if (text) {
      this.history.push(`/alert/list?severity=${text}`)
    } else {
      this.history.push(`/alert/list`)
    }
  }

  componentDidMount() {
    this.setState({ listLoading: true });
    this.getCluster();
    this.getbackup();
    this.getAlerts();
    this.setState({ listLoading: false });

  }


}

